import heapq

class Solution:
    def connectSticks(self, sticks):
        cost = 0
        heapq.heapify(sticks)
        while len(sticks) > 1:
            first = heapq.heappop(sticks)
            second = heapq.heappop(sticks)
            sum = first + second
            cost += sum
            heapq.heappush(sticks,sum)
        return cost




